import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

console.log(`
üöÄ STELLAR FUNDING PLATFORM
===========================
‚úÖ React app starting...
üåê Available at: http://localhost:3000

üì± Features:
- Responsive design
- Donation modal
- Campaign tracking
- Impact dashboard
- Real-time updates
`);

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
